测试加密方式是否正常：可以在v2ray.com/core/proxy/vmess/encoding/client.go中设置断点打印
最简单的能用的vmess协议配置:
// client
{
  "inbounds": [
    {
      "port": 7000,
      "protocol": "socks",
      "settings": {
        "auth": "noauth"
      }
    }
  ],
  "outbounds": [
    {
      "protocol": "vmess",
      "settings": {
        "vnext": [
          {
            "address": "0.0.0.0",
            "port": 16823,
            "users": [
              {
                "id": "b831381d-6324-4d53-ad4f-8cda48b30811",
                "alterId": 64
                "security": "none" // change encryption method here
              }
            ]
          }
        ]
      }
    }
  ]
}

// server
{
  "inbounds": [
    {
      "port": 16823,
      "protocol": "vmess",
      "settings": {
        "clients": [
          {
